import React from "react";
import styled from "styled-components";
import { Link } from "react-router-dom";

const MainNavBar = style.div`
    display: flex;
    align-items: center;
    height: 5rem;
    rgba(20, 20, 20, 0.1) 10%;
    border: 2px solid black;
    margin: auto;
    .lis{
        font-color: white;
        font-weight: 1.5rem;
        padding: auto;
    }
`

export const MainNav = () => {
    return(
        <>
            <MainNavBar>
                <div className = "lis">
                    <Link to = "/home">홈</Link>
                </div>
                <div className = "lis">
                    <Link to = "/notice">공지사항</Link>
                </div>
                <div className = "lis">
                    <Link to = "/">포스트</Link>
                </div>
            </MainNavBar>
        </>
    )
}
